	 (112,'2023-09-29 14:45:04.163240','2023-09-29 14:45:04.163240',86,'플랙진 SLENDER 청바지 슬림 스판 워싱 데님팬츠 사이즈33 상품번호  9931 권장사이즈  33인치 허리  42cm 총장  106cm 밑위  25cm 허벅지  28cm 밑단  17cm  PLAC JEANS의 SLENDER 제품으로 스판기 있는 슬림핏 스타일 제품입니다.   사진과 상세 사이즈 참고해 주세요.  사이즈는 자로 실측한거라 빈티지 상품 특성상 바지에 있는 택과 다를수 있음을 알려드립니다.  vintage119 에서 파는 모든제품은 직접 선별검수 후 세탁해서 올리는 것으로 받는 즉시 입으셔도 됩니다.','서울 관악구 관악로15길 23-12',24000,'SELL','플랙진 슬림 스판 데님 사이즈33 NO.9931',NULL,2),
