	 (458,'2023-09-15 15:09:18.510957','2023-09-15 15:09:18.510957',622,'아이폰14프로 128 골드 박스풀구성 판매합니다. 필름부착  케이스 착용 상태 사용으로 깨끗한 상태이며, 밧데리효율 98입니다. 맥세이프투명케이스와 여분 강화유리필름 원할시 함께 드리도록 하겠습니다 직거래시 주중 6시 이전 내방역 7번출구 그외시간은 부천 송내동 부천여중정문 거래가능합니다. 택배시 GS 편의점 반값택배 가능합니다.','서울 관악구 관악로15길 23-12',900000,'SELL','개인(SS급) 아이폰14프로 골드 128 자급제',NULL,4),
