	 (492,'2023-10-27 15:10:47.396294','2023-10-27 15:10:47.396294',870,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사 브랜드 명과 상품명ex. BESPOKE 4도어 를 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다 아이와 3 way 스피커 SXZ929 소리 잘 납니다. 엣지 말짱하고 사진에 자세히 보심 가상사리와 뒤쪽에 까진 곳 있습니다. 망 약간의 구멍이 있습니다. 수지구 성복동에서 거래 가능합니다. 택배 가능한데 전자제품 접수불가라 다른 품목으로 해서 보냅니다. 물론 파손면책입니다. 포장은 세계에서 제가 젤 잘합니다. 좌우전후상하 골고루 완충해서 보냅니다. 보통 위나 아래 쪽만 잔뜩 완충해서 보내는데 저는 절대로 그렇게 안 합니다. 특히 이렇게 무거운 제품은 그렇게 하면 당연히 탈 납니다. 100,000원 택배거래 시 110,000원입니다. 박스 두 개로 나누어서 보냅니다. 당일 접수 불가능하며 15일 후에 공휴일 제외 접수하고요 일반택배의 경우 사이즈가 큰 경우에는 맞는 박스를 찾느라 며칠 걸릴 수도 있으니 양해바라요. 송금확인과 송장번호는 요청시에만 보내드립니다.','서울 관악구 관악로15길 23-12',100000,'SELL','아이와 3 way 스피커 SX-Z929',NULL,1),
