	 (496,'2023-10-06 15:10:54.770069','2023-10-06 15:10:54.770069',653,'22년 1월 S급 리퍼 상품으로 400에 구입했습니다. S급이지만 수령할 때 상태 꼼꼼하게 체크하여 새상품 수준으로 양품 받았습니다. 퇴근 시간이 늦어 집에 오면 자기 바쁘고 주말에는 외출하여 정말 실사용 횟수가 손에 꼽힙니다. 마침 이사도 가야하는데 잘 사용하지 않아서 판매를 결정했습니다. 제품 상태는 두말할 필요 없습니다. 정말 깨끗하고 모든 기능 완벽하게 정상작동합니다. 가죽 닳음이나 그런거 전혀 없구요 리모콘에 보호 비닐도 그대로입니다. 안마의자는 한 번 설치하면 이동하는 게 안좋다는 글을 봐서 그런지 구매 이후 한 번도 이동한 적이 없습니다. 처음 설치 장소 그대로 지역은 대구이며 구매 시 사설업체나 다른 운송 수단으로 직접 가지고 가셔야 합니다.','서울 관악구 관악로15길 23-12',2500000,'SELL','바디프렌드 더파라오 카멜레온골드',NULL,2),
	 (497,'2023-10-20 15:10:57.578336','2023-10-20 15:10:57.578336',485,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.  백화점 구매정품이며,개봉만해서 사진만 찍었어요. 구성품.박스도 다있구, 사용안한거라 새거입니다. 블루코퍼는 지금 공홈서두 젤 세일폭이 적어요. 그만큼 인기있구요. Hd15모델이라, 플라이어웨이스무더 굉장히 유용한튤입니다. 드라이롤빗없이 한손으로 하니 넘넘편해요. 전 같은모델 사용하는게 있어 내놓아요. HD15입니다.','서울 관악구 관악로15길 23-12',420000,'SELL','다이슨 슈퍼소닉.HD15블루코퍼.개봉만한새것! 올9월백...',NULL,1),
	 (498,'2023-10-20 15:11:01.118420','2023-10-20 15:11:01.118420',577,'UV프린터 판매합니다. 신사업용도로 구매했는데, 사용빈도가 없을것 같아 처분합니다. 사용횟수 거의없고 테스만 좀 했습니다. 새기계나 다름없습니다. 구동PC포함. 인쇄규격은 900600mm 입니다. 프린트헤드는 3헤드입니다. 2개월만에 반값에 정리합니다. 부천직거래, 상차도금액 세금계산서가능 VAT별도','서울 관악구 관악로15길 23-12',5500000,'SELL','UV 프린터기',NULL,4),
