	 (500,'2023-10-27 15:11:05.214515','2023-10-27 15:11:05.214515',441,'작녁 구입후 보관하다 판매합니다. 작동이상없는것 확인하였습니다. 작동 동영상 같이 올렸습니다. AA배터리 3개로 작동하니 별도 외부 전원 필요없기에 공각 제약없이 어디든 둘 수 있습니다. 박스풀셋 입니다. 택배거래가능하며 직거래는 수원 용인 입니다. 검색하면 최저가 6.1만원이지만 배송비가 1만원이니 실구매 최저가 7.1만원인 상품입니다.','서울 관악구 관악로15길 23-12',50000,'SELL','코스트코 크리스마스 워터 글로브 기차',NULL,4),
