	 (536,'2023-09-15 15:12:46.534996','2023-09-15 15:12:46.534996',520,'타옥 ASRII 3단 실버 오디오 랙 판매 가성비 좋은 좋고 심플합니다. 상태는 전체적으로 깨끗하지만 스크래치 여기저기 있습니다. 아직 사용하고 있지만 검정색도 있습니다 높이 65cm x 폭 60 x 깊이 53 플레이트 크기 1단 높이 28cm, 2단 높이 23cm 필요하시면 1,2단 둘다 23cm 으로도 가능합니다 가격  75만원 마포 직거래  분해해서 박스 택배 가능 문의  안심번호','서울 관악구 관악로15길 23-12',750000,'SELL','타옥 ASRII 3단 실버 오디오 랙 판매',NULL,5),
	 (537,'2023-08-25 15:12:49.464337','2023-08-25 15:12:49.464337',918,'Line6 AMPLIFi FX100 멀티이팩터 아답터 포함입니다. 원박스도 있습니다. 블루투스 연결해서 이것저것 할게 많은 이팩터입니다. 16만원 Digitech GNX3 멀티이팩터, 영문 매뉴얼, 아답터 포함 입니다. 10만원 DUNLOP GCB95 Crybaby Wah 유명한 와패달 입니다. 8만원 DigiTech DDM Death Metal 4만원 Boss CH1 Super Chorus 6만원 BEHRINGER DI400P 패시브 다이렉트박스 2만원 기타 접으면서 저렴하게 그동안 모았던 각종 이팩터 패달 저렴하게 정리합니다. 모두 작동에 이상없고 상태는 사진으로 확인 부탁드립니다. 직거래 전북 군산이고, 꼼꼼하게 포장해서 착불 택배거래 가능합니다. 문의 01공266팔855삼','서울 관악구 관악로15길 23-12',20000,'SELL','각종 이팩터 패달',NULL,4),
