	 (541,'2023-09-29 15:12:59.497408','2023-09-29 15:12:59.497408',165,' 브랜드  바로나 저주파 온열찜질 매트  모델명  JHEGLE J2  사용기간  약3년  구매시기  부모님이 구매하셔서 정확치 않음. 시기는 좀 되었음.  제품상태  사진상에 보여지는 것처럼 돌 빠진것 없이 상태는 좋음  두께가 있고, 매트가 매우 무겁기 때문에 일반적으로 옮길 수 가 없습니다. 일반 자동차에도 실리진 않을듯 하네요. 직접 가져가실 수 있는 분이 연락주세요. 어머님이 전에 업소에 가서 하루종일 시간 보내시고 노시고 식사도 하시고 소일거리 보내던 차라, 거기 물건이라도 구매해야 계속 다닐 수 있겠다싶어 300만원 넘게 주고 사신겁니다. 온열기능도 있지만, 저주파 때문에 사신것 같아요. 지금은 사용하지 않아서 내놓습니다.','서울 관악구 관악로15길 23-12',200000,'SELL','바로나 게르마늄 온열 찜질 매트',NULL,4);
