	 (637,'2023-09-22 15:25:29.899000','2023-09-22 15:25:29.899000',329,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사 브랜드 명과 상품명ex. 맥북 에어 13를 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다 미개봉 새제품 2023년 10월 26일 구매품으로 영수증 함께 드립니다. 직거래는 시흥 거북섬 or 김포 양촌 주변에서 가능합니다. 그 사이 어디쯤에 계시면 배달도 가능합니다. 택배시 4천원 추가입니다. 10년 이상 이곳에서 300건 넘게 문제없이 거래해왔습니다. 신용도는 믿으셔도 좋습니다.','서울 관악구 관악로15길 23-12',1380000,'SELL','ASUS ProArt RTX 4080 (미개봉)',NULL,1),
