	 (666,'2023-09-15 15:26:44.651219','2023-09-15 15:26:44.651219',981,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사브랜드 명과 상품명ex. 200D II 카메라을 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다 안녕하세요. 필름카메라  올드렌즈 정리합니다. 광학부 곰팡이발삼헤이즈나 눈에 띄는 기스먼지는 기본적으로 없다고 보시면 되고, 특별히 있는 경우에만 따로 언급하겠습니다. 외관구성품은 사진 찍어놓은 그대로 입니다. 주말에 거래할 시간이 없어서 당분간 택배거래만 합니다. 판매금액은 5만원 단위로만 내리는데, 충분히 잘 팔리는 가격까지 내렸다고 생각하지만 안팔리면 알아서 더 내리던가 하겠습니다. 1. Leitz Wetzlar Leica R4  Leitz Wetzlar SummicronR 50mm F2 2nd Gen. 라이카 필름 SLR 입니다. 노출계 등 모든 기능 정상 작동하고, 알상태 좋은 주미크론R 502 2세대, 3캠 버전, R3R9와 완벽 호환 포함입니다. 모든 올드렌즈 다 써봤고 좋기로 유명한건 빠짐없이 보유중이지만, 주미크론R이 올드렌즈 50미리중 광학 성능만큼은 원탑입니다. 2세대는 1세대보다 광학 성능이 개선됐고 필터 구경도 55mm로 커진데다 후드 내장이고 무게도 더 가볍고 멋있어서 인기가 더 많습니다. 이베이 시세도 렌즈만 최소 60만원수입관부가세 20로 높은 편입니다. 저도 2세대를 남기고 1세대를 팔고 싶었지만.. 1세대는 미터링이 R3R9와 완벽하게 호환되지 않아서 바디와 제짝인 2세대를 팔겠습니다.. 상태 좋은 매물 구하기도 어렵거니와 이보다 저렴한 매물은 없습니다. 판매금액 택포 70만원  ...','서울 관악구 관악로15길 23-12',300000,'SELL','라이카R4, 주미크론50/2, 주마50/2, 캐논P, ...',NULL,4),
