	 (695,'2023-09-22 15:27:56.537947','2023-09-22 15:27:56.537947',339,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사브랜드 명과 상품명ex. 200D II 카메라을 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다 캐논 AE1 바디 부품용 고장이 나서 셔터가 안되네요. 인테리어용이나 부품용이나 남대문에서 수리해서 쓰실분은 연락주세요. 환불반품은 안됩니다. 하자로 인해 3만원 직거래  삼성역 근처 강남역잠실역 사이 지하철2호선역 반값택배  2000원 일반우체국택배  4000원','서울 관악구 관악로15길 23-12',30000,'SELL','캐논 AE-1 바디 (부품용)',NULL,5),
