	 (749,'2023-09-29 15:30:32.082860','2023-09-29 15:30:32.082860',243,'40만원대 후반에 구매했던 수납장인데, 가격 많이 할인하여 판매합니다.  튼튼한 유럽산 프랑스 오크원목으로 만들어서 견고하고, 화이트 색상으로 포인트  책장, 수납장, 화장대로 사용하기 좋습니다.  상태 새것처럼 아주 좋으며, 구매된지 1년정도 됩니다.  배송은 용달 착불입니다. 1. 수납장데스크 색상 화이트 재질 오크 프랑스 사이즈 가로 70  세로 35  높이 130 cm 문의주세요','서울 관악구 관악로15길 23-12',100000,'SELL','수납장/데스크 (오크원목) 판매합니다',NULL,3),
	 (750,'2023-09-08 15:30:34.235348','2023-09-08 15:30:34.235348',881,'시몬스 팔로스 침대프레임 라지킹LK 사이즈  1719W x 2529L x 948H 모카 색상 2016년 중순 200만원 중반대 구매 헤드부분 각도조절 가능 책도 보고 아기도 안고 하라며 부모님이 사주신 침대라 애지중지 깨끗하게 사용했습니다. 생각만큼 다양하게 활용은 못하여 헤드부분 각도조절 잘 되고 가죽 헤짐도 없습니다. 양쪽 포켓에 리모콘이나 휴대전화 등 꼿아둘 수 있는데 아예 사용하지 않아 늘어짐 없습니다. 게시물 올리려고 자세히 뜯어보니 아래쪽 모서리 주변에 1cm 미만 갈라짐이 있던데 사진 첨부합니다. 가죽침대라 아이들 다칠 걱정 없고 어른도 발 다리 부딪혀도 부드러워 아주 만족하며 사용했습니다. 모카색상도 브라운 그레이 묘하게 섞여 고급집니다. 집에서부터 직접 가져가주셔야 합니다. 서울 서초동 3호선 남부터미널역 인근 주차장과 엘레베이터 사용 가능합니다. 기본매너 지켜주시는 분과 거래하고 싶고 에눌문의는 사양합니다. 부피가 크고 중고거래임으로 교환,환불은 불가합니다. 소중히 생각했던 물건이라 잘 사용해주실 분 만나길 바랍니다. 댓글, 쪽지, 채팅 주세요','서울 관악구 관악로15길 23-12',220000,'SELL','시몬스 팔로스(palos) 가죽침대 프레임 라지킹',NULL,2),
