	 (864,'2023-10-13 15:35:32.223333','2023-10-13 15:35:32.223333',419,'제네시스 eq900 19인치 중고휠타이어 판매 남양주 휠 상태는 A급 상태이며 깨끗한 상태 입니다 타이어 24545192754019트레이드 7080 정도 거래지역 남양주다산신도시 인근 위치에 있습니다 장착비무료 연락처 01091591061 가격 120만 대품조건   카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사 브랜드 명과 차종ex. 아반떼 CN7를 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다','서울 관악구 관악로15길 23-12',1200000,'SELL','제네시스 eq900 19인치 중고휠타이어 판매 남양주',NULL,4),
