	 (866,'2023-09-08 15:35:38.077917','2023-09-08 15:35:38.077917',241,'관리번호  22072041602 2018년 I30 PD 2열 시트 팝니다. 분할 시트 입니다. 방문수령 및 퀵배송과 택배배송 가능합니다. 장착은 하지 않고 판매만 진행 합니다. 궁금한 점은 아래 담당자 번호로 문의 바랍니다. 강원폐차 경기도 화성시 담당자 연락처  01043619574 화성 직거래 우선 합니다 택배시 파손 있을 수도 있어요 택배거래도 가능합니다 택배 배송중 일어나는 파손 및 고장으로 인해 직거래를 우선하긴 합니다. 택배거래시 파손면책에 동의한 것으로 간주하고 발송해 드립니다. 택배 발송은 결재일 당일 오후 2시 이전 주문건에 대하여 당일 발송 해 드립니다. 오후 2시 이후 주문건은 익일 발송 됩니다. 카드결재, 현금영수증 및 세금계산서 발행 시 부가세 별도 청구 됩니다. 중고 부품의 특성상 장착 및 탈거 시 발생되는 공임에 대한 부분은 책임지지 않습니다. 중고 부품입니다. 만에 하나 있을 제품상의 문제에 대해서는 구매일로 부터 일주일 이내 연락주셔야 교환이든 반품이든 가능하십니다. 제품의 문제가 혹여라도 있다면 교환을 우선으로 합니다. 제품에 문제가 없을 시 교환 및 반품은 불가하니 신중히 생각 후 구매 바랍니다. 자동차 중고 부품 이것저것 판매중이니 필요하신 경우 연락주세요 연락처  01043619574 담당자 직통번호','서울 관악구 관악로15길 23-12',150000,'SELL','[GW] 베뉴 벤뉴 2020년 2열 분할 시트 팝니다.',NULL,2),
