	 (894,'2023-10-13 15:36:56.399616','2023-10-13 15:36:56.399616',11,'안녕하십니까. 조작감 및 그립감 최고의 게임기 구형 닌텐도ds입니다. 닌텐도 ds 구형nds 실버 S급판매합니다. 네고 죄송합니다.일판기기 입니다. 메뉴만 일어이고 정발칩 정상구동되는점 참고하세요. 저의 프로필을 클릭하시면 닌텐도ds다양한 상품이 판매중이니 확인해주세요 판매중인 기기설명 새제품 케이스로 교체하였습니다. 외관은 당연히 새제품급으로 상태는 최상입니다. 메인 보드 액정제외 모두 신품이라고 보시면 됩니다. 상.하 액정 깨끗합니다. 케이스 규격 잘맞고 버튼감 좋습니다. 전면부 상단 살짝 작은 기스하나 있습니다. 후면부 배터리커버 실기스 살짝하나 있습니다. 전원키면 닌텐도 로고없이 바로메뉴화면뜹니다. 전원off시 하단액정 잔상남았다가 사라집니다. 게임시 지장없는 하자지만 혹시나 예민하신분이 있을까 미리말씀드립니다. 경첩 2단계 고정 이상없습니다. 모든 동작 테스트 하였습니다. 구ds는 액정밝기는 원래2단계로 dsl보단 어두우니 이점 오해마시고 참고바랍니다. 기기상태는 사진을 참조바랍니다. 작은 하자는 아래에 따로 명시하겠습니다. 1.외부,내부케이스 상태주간적인 저의기준 S급 2.하자 3.구성품 본체.충전선.펜 4.거래방법 택배 편의점 일반택배 4000추가 편의점 gs25반값cu끼리택배 2000추가 직거래장소 서울시 노원구 한글비석로24바길 54 다정어린이집 5.결제방법 안전결제,직접결제 필 가급적 중고 제품이다보니 단순변심 환불은 안되니 신중히 거래주세요. 감사합니다','서울 관악구 관악로15길 23-12',75000,'SELL','닌텐도 ds ds lite 구형ds 구ds s+급',NULL,4),
