	 (905,'2023-10-06 15:37:26.911383','2023-10-06 15:37:26.911383',573,'게임용 스틱이 아니라 게임기가 내장된 스틱입니다. 스틱안에 게임이 포함된 라즈배리 3b 내장 되어있구요. 스틱에서 tv에 바로 hdmi로 연결해서 게임하시면 됩니다. 게임이 내장된 64기가 메모리 포함입니다. 스틱 가운데 oled 액정에 게임 제목 표시됩니다. 몇년전에 동호인 카페에서 공제 했던 케이스로 직접 만든겁니다. 만들때는 평생 사용하려고 좋은 부품 많이 사용했습니다. 자세한 문의 사항은 채팅또는 댓글남겨주시면 자세히 설명 드리겠습니다. 크기와 무게 아크릴 파손 위험으로 택배는 절대 불가합니다. 직거래만 가능합니다. 삼덕사 309m 레버, 삼덕사 체리 버튼 oled 액정 라즈배리 3b 스틱안에 스피커 내장으로 tv와 스틱 스피커로 번갈아 사용 가능합니다. gpio연결 전원부는 smp내장 되어있어서 220v 전원선만 연결하시면 됩니다. 직거래 경기도 고양시 덕양구 화정동 입니다. 크기 80022050 무게 7.1kg 댓글 또는 체팅 남기시면 연락처 남기겠습니다.','서울 관악구 관악로15길 23-12',250000,'SELL','라즈베리 게임이 내장된 2인용 스틱 게임기',NULL,2),
