	 (945,'2023-09-15 15:42:56.441891','2023-09-15 15:42:56.441891',529,'오늘만 맡김시 대폭 할인  탑 빼고 전 라인 가능 주포지션  미드 정글 본상점이 차단되어 새계정으로 글 올립니다 빠르게 티어 올리고싶다. 승급하고싶다. 말씀주세여 빠르게 도와드립니다. 찔러보기 문의글 편하게 주세여 개인이기 때문에 가격혜자임당  사기를 당하고 찾아오시는분들이 참 많습니다. 저는 하나 약속드리겠습니다. 돈으로 장난 안치고 추잡해지지 않겟습니다 끝까지 책임져 드립니다. 여기저기 시세보다 싼가격에 사기당하시지 마시고 저한테 오시면 잘해드리겠습니다. 믿을만한 실력 보여드리겠습니다. 꼼꼼하게 개인으로 도와드리고 있으니 언제든지 문의주시면 감사하겠습니다 많은 고객 후기와 작업후기 보유중입니다 기사의 실력을 알고싶으면 우선 한판만 진행하셔도 됩니당. 연락 많이 주세용  상태 좋습니다','서울 관악구 관악로15길 23-12',2023,'SELL','최저가)롤듀오 강의 맡김 개인 서포터즈대리 롤 듀오',NULL,3),
