	 (982,'2023-10-06 15:53:38.030352','2023-10-06 15:53:38.030352',534,' 카페 상품 게시글은 자동으로 중고나라 앱사이트에 노출합니다. 노출을 원하지 않으실 경우 고객센터로 문의 바랍니다.  등록한 게시글이 회원의 신고를 받거나 이상거래로 모니터링 될 경우 중고나라 사기통합조회 DB로 수집활용될 수 있습니다.   제목에 제조사 브랜드 명과 상품명를 넣어 작성하면, 보다 빠른 판매가 가능합니다  게시글 작성 시 배송 방법에 직거래와 내 위치 설정할 경우, 보다 빠른 판매가 가능합니다 세 제품입니다 색상 회색 사이즈는 MLXL 있습니다 M은 성묘 1마리 L은 성묘 2마리 XL은 성묘 23마리 정도 충분히 들어갑니다 추위에 떨고 있는 길냥이들을 위해 따뜻하게 지낼 수 있는 방수와 보온이 함께 된 하우스입니다 두툼한 마감으로 쉽게 무너지지 않아 튼튼하게 유지 가능합니다 내부가 깜깜하고 아늑하니 길고양이들이 좋아합니다 바닥에 부드러운 촉감의 털로 거부감 들지 않아 딱 입니다 특히 출산을 앞둔 어미 고양이들에게 사용하기 좋았고 생각보다 하우스 크기가 커서 새끼들도 충분히 들어갑니다. 길고양이 하우스가 아닌 집에서 사용하기도 좋습니다 사진과 같이 하우스 안이 어둑하고 푹신 아늑하니 잘 놉니다. 추운 겨울이 찾아오는 시기에 길고양이들에게 따뜻한 집을 마련해 주는 건 어떨까요','서울 관악구 관악로15길 23-12',13000,'SELL','길고양이 겨울집,고양이숨숨집 세제품',NULL,2),
