	 (1004,'2023-10-06 15:54:26.975739','2023-10-06 15:54:26.975739',839,'200만원대에 출시되어 단종직전 100만원대중반에 판매된것으로 기억합니다. 랙을 롤랜드 mds9v 스탠드로 업그레이드 하였습니다. 케이블도 고장난거 버리고 새로 바꾸어놓고 전원어댑터도 새거로 사는 등 유지보수 하였습니다. 케이블 헷갈리지 않게 모듈레이션에 꼽아놓고 고정해서 드리겠습니다. 이어폰에도 연결할 수 있게 5.5  3.5 변환어댑터도 드리며, 원하시면 드럼스틱이나 카탈로그도 책갈피에 꼳아서 드리겠습니다. 작동확인영상입니다. httpsyoutu.bevUs4Zm3nMngsiqjOfMarS78bq72Ey 작동 문제없으며, 외관도 사진과 같이 준수한 편입니다. 킥 타격패드는 소음때문에 소음없는 킥페달로 교체하여서 바닥소음도 거의 없습니다. 림샷 가능한 3존 스네어로 교체,심벌 추가 원하시면 따로 문의주세요. 택배시, 완충재 구매하여 안전하게 포장합니다 택배비 완충비 포함가 입니다.','서울 관악구 관악로15길 23-12',540000,'SELL','야마하 전자드럼 dtxpress ii 2 /랙업그레이드',NULL,2),
	 (1005,'2023-10-27 15:54:30.253372','2023-10-27 15:54:30.253372',319,'스즈키 바이올린 550호  sv550  44 1979년 제작된 모던 바이올린으로, 프로 연주자분들도 사용하시는 중상급 모델입니다. 인터넷,악기사에서는 328만원에 판매되고 있네요 갈라짐 깨짐 등 크랙 없습니다. 사운드 포스트 장착되어 있습니다. 통기타 보관하는 곳에 온습도 유지하며 같이 보관하였습니다. 장기간 줄장력 풀고 보관해서 재세팅이 필요할 수 있습니다. 활은 스기토 800입니다. 새상품은 얼마인지 모르겠고, 중고로는 750달러정도에 판매되고 있네요. 직거래 시, 경북 영주시입니다. 가격대가 있다보니 받으러 오시는게 좋을거 같습니다. 택배시, 완충재로 맞춤포장하여 굉장히 탄탄하게 안전포장,방탄포장 합니다. 뽁뽁이로 감싸고, 스티로폼으로 잘라다가 3중4중 방탄포장합니다. 던져도 멀쩡할 정도로 안전포장하므로 그럴일은 없겠지만, 혹시라도 파손도착 환불 가능합니다. 다만 택배 도착 당일날 확인 부탁드립니다.','서울 관악구 관악로15길 23-12',1350000,'SELL','바이올린 스즈키 sv-550 4/4',NULL,1),
	 (1006,'2023-10-06 15:54:34.010502','2023-10-06 15:54:34.010502',510,'미개봉 새상품. 온라인에서 판매하는 애견 타올 중 제일 큰사이즈로 제작된 상품입니다. 중대형견 목욕후 충분히 말리고 남아요. MEGA Large size 680 X 1320 mm 색상은 가필드 메가 LARGE 그레이 가필드 메가 LARGE 화이트 CUGS반값택배 이용가능. 가격협상X','서울 관악구 관악로15길 23-12',15000,'SELL','가필드 PREMIUM 애견 목욕타올 극세사특대형SIZE',NULL,1),
