	 (1109,'2023-09-22 15:58:46.458369','2023-09-22 15:58:46.458369',103,'안녕하세요. 각종 영상 편집 제작해 드립니다. 병.의원  학원  회사  행사  개인  브이로그 유튜브 영상 편집  각종 편집 원하시는 목적에 맞는 편집, 컷편집 , 대사 자막 효과 자막 , 배경음악 등 편집을 완렁 해 드립니다 의뢰방법  1. 영상 원본 길이나 원하는 완성본 영상의 길이 2. 필요한 편집내용 전달  컷편집  자막  대사 자막  효과  배경음악 등 3. 원하시는 스타일 참고 영상등필수 사항x 망설이지 마시고 편하게 문의해 주세요. 최고의 친절과 영상으로 보답하겠습니다','서울 관악구 관악로15길 23-12',10000,'SELL','각종 영상 편집 제작해 드려요',NULL,2),
