	 (1404,'2023-09-29 16:19:02.595384','2023-09-29 16:19:02.595384',313,'소비자가격은 385만원 입니다만, 전시용 샘플이라서 120만원 입니다. 번호판 미장착할 경우 신청당일 수령 가능합니다 모두나와 전기오토바이는 리튬배터리72V40A를 장착했고 모터는 2000W파워에 최고속도 70키로에 1회충전 운행거리는 100키로를 주행합니다. 번호판 장착할경우는 책임보험을 의무로 가입하셔야 하며, 보통 50세 전후의 연령은1년에 9만원정도 보험료 책정됩니다. 그리고 번호판 부착 하려면 실측검사 및 여러가지 인증 받아야 합니다. 실측인증비 및 대행료는 50만원 정도 비용이 추가로 발생합니다. 번호판 장착할 경우 등록비포함 최종구입가격 170만원. 번호판 미등록 구매가격 120만원 입니다. 앞 철바구니는 무료로 증정하고 뒷면 배달통은 10만원 입니다. 번호판 등록 및 배달통장착까지 총금액 170만원 입니다. 문의사항은 010 사이칠일 삼팔일이','서울 관악구 관악로15길 23-12',1200000,'SELL','모두나와 전기스쿠터 m1',NULL,2),
