	 (1406,'2023-09-08 16:19:11.563975','2023-09-08 16:19:11.563975',391,'2016년식이며 2015. 9. 30 신차 구입 후 등록하여 출퇴근용으로만 사용하였습니다.24,830Km 주행 무사고이며 주차중 주차차량에 밀려 우쿵 1회로 머플러 보호 플라스틱에 약 3센치 정도 금이간 흔적 있습니다. 지금까지 뒷바퀴 타이어 1회 및 점화플러그만 교체 하였고 나머지는 신차 그대로입니다. 회사나 집에서 항상 지하주차장에만 주차하여 비 맞힌적 거의 없어 녹이나 부품등에 빛바램등 일절 없이 신차처럼 아주 깨끗합니다. 아이나비 v900 블랙박스전후 2채널 장착되어 있고 우천시에도 자작 방수 비닐커버가 있어 사용 문제 없으며 자동 포맷 지원 되므로 편리합니다. 샤드 39탑박스 부착되어 있고, 제품값만 25만원 상당의 대만제 KOSO 열선 히팅 토시글러브 구입하여 쉽게 탈부착할 수 있도록 배선작업 되어 있으며 구입시 함께 드리겠습니다.겨울철 장갑 없어도 손은 따듯하게 탈수 있음 얼마전 직장을 퇴직하여 사용하지 않고 있으며 그간 장거리 운행이나 배달용으로 사용하지 않고 아끼며 운행하여 상태는 정말 최상이라고 생각합니다. 위 내용이 사실과 다를시 전액 환불 가능합니다. 구입당시 있던 사용설명서 책자, 수리키트, 탑박스열쇠 2개, 키 2개 모두 있으며, 원하시면 사용했던 홍진크라운 헬멧도 함께 드리겠습니다. 평일 주말 아무때나 거래가능합니다. 노원구 중계동 직거래입니다. 010 5509 2254','서울 관악구 관악로15길 23-12',1800000,'SELL','pcx 125(2016년식, 24,830km)',NULL,4),
	 (1407,'2023-10-06 16:19:13.815147','2023-10-06 16:19:13.815147',849,'2017년식 SYM 울프 완벽커스텀 판매합니다. 2017년식 SYM 울프125 모델을 베이스로 커스텀 한바이크입니다. 서류는 최근 폐지해서 3장 가지고있습니다. 키로수는 1만6천 주행했습니다. 현재 시동 일발이고 엔진도 잡음없이 조용합니다. 기어변속 부드럽고 주행도 땡기는대로 쭉쭉 잘 나가줍니다. 튜닝내역 튜닝 소세지머플러 탱크 헤드라이트 LED 깜박이 및 LED 테일램프 시트 핸들 리어 업쇼바 오픈흡기필터 키박스 위치변경 엔진 상태좋고 딱히 문제될게 없네요. 정말 공들여 만든 바이크입니다. 좋은주인 기다립니다. 더 궁금하신건 휴대폰으로 연락주세요. 230만원에 판매하고 직거래,화물거래 둘다 가능합니다. 지역은 서울 7호선 까치울역 또는 1호선 송내역 입니다. 010  56O3  9I7O 문자,전화 주세요.','서울 관악구 관악로15길 23-12',2300000,'SELL','2017년식 SYM 울프 완벽커스텀 판매합니다.',NULL,1),
	 (1408,'2023-10-27 16:19:17.685838','2023-10-27 16:19:17.685838',193,'2011년식 뉴티맥스 TMAX 튜닝된 상태좋은 바이크 판매합니다. 2011년식 6만6천키로 주행한 TMAX 뉴 티맥스 입니다 서류는 폐지해서 3장 갖고 있는상태입니다. 기본점검은 다해둔상태고 바로 등록후 타면 됩니다. 현재 클러치 스베루,슬립 나는것없이 감는대로 쭉쭉 치고나갑니다. 구동계 문제없고 그외 엔진,주행,밸런스 괜찮습니다. 타이어,브레이크패드 적당히 남아있습니다. 직접 바이크보고 시승후 결정하시면 좋을거 같습니다. 튜닝내역 아크라포빅 머플러 구조변경완료 면발광 LED 스위치 ONOFF 있음 알루미늄 탑박스 금장 파츠 ABS 정상이고 그외 경고등 뜨는것없이 양호합니다. 바이크 관해 더궁금하신건 휴대폰으로 연락주세요. 350만원에 판매하고 직거래,화물거래 둘다 가능합니다. 직거래는 서울 7호선 까치울역 또는 1호선 송내역 입니다. 010  56O3  9l7O 문자,전화주세요.','서울 관악구 관악로15길 23-12',3500000,'SELL','2011년식 뉴티맥스 TMAX 튜닝된 상태좋은 바이크 ...',NULL,3),
