	 (1418,'2023-09-01 16:19:47.606792','2023-09-01 16:19:47.606792',611,'sv650x 21년식 모델입니다. sv650의 카페레이서 버전으로 공격적인 포지션이 흡사 레플리카와 비슷합니다. 17년식의 작은 기름통을 개선. 1819년식의 단동식 2p 브레이크를 4p 복동식으로 개선. 유로5적용으로 인한 8벨브 4플러그 시스템적용. 다듬고 다듬어진 21년식 입니다. 브레이크 개선으로 느껴지는 체감이 비엠급은 아니지만 엄청좋네요. sv사실거면 20년식 유로4or 21년식이후가 좋습니다. 저는 차후 부품단종 문제를 고려해 21년식을 선택했습니다. 이번주에 가지고와서 등록마쳤는데 와이프랑 같이 탈 세컨바이크로는 저나 와이프 모두 너무 버거워하네요. 슬렁슬렁 근교 타려고 삿는데.. 그리고 그간 쭉 클래식이랑 커브만 타온 제 몸이 더이상은 속도를 원하지 않는 것 같아서 취등록세만 날리고 판매합니다. 좋은 경험이었다고 생각합니다. 튜닝내역은 아래와 같습니다. 레오빈스 듀얼머플러 소음기끼고 구변완료. 라지에이터 가드 대구공돌 발란스 바엔드미러 탱크패드 및 니그립패드 엔진가드 사이드캐리어 좌우 퓨익 머드가드 모토즈aaa헤드라이트 그릴 발터 텐덤그립 코미네 고속충전 방수시거잭 2개 프론트브레이크 리저브탱크 캡 타이어 벨브캡 스윙암 후크볼트 이노브 신형 2채널 블랙박스 휴대폰거치대 키지마 헬멧락 사이드넘버플레이트 좌우 키 두개보유 스즈키 정품 가죽키링 오너스 메뉴얼 및 정비노트 멀리 전남매물 올렸습니다. 튜닝내역 많고 새것같습니다. 구변은 소음기끼고 되어있습니다. 레오빈스가 소음기빼면 104데시벨인데 추후 흡음제 털리변 구변받기 힘듭니다. 바엔드미러 진동없고 왜곡없고 정말 좋습니다. 발터 그립같은경우 요즘 구하기도 힘듭니다. 배선정리가 워낙 잘 되어있어서 깔끔합니다. 순정 머드가드가 없습니다. 퓨익제품으로 전주인이 달아놓았습니다. 사진에는 없으나 사이드넘버플레이트 좌측것 있습니다. 전주인분의 아주 미세한 주차장좌꿍 있습니다. 엔진가드에 정말 티가 날랑말랑 한 상처 말곤 없습니다. 아마 말씀안드리면 모를정도입니다. 우측 스윙암쪽에 새끼손...','서울 관악구 관악로15길 23-12',7850000,'SELL','21년식 sv650x 신차급 튜닝다수 팝니다',NULL,2),
