	 (1430,'2023-10-27 16:20:30.413050','2023-10-27 16:20:30.413050',390,'2016년식 KTM 듀크125 ABS 모델 판매합니다. 2016년식 KTM 듀크 DUKE125 ABS 입니다. 서류는 최근 폐지해서 3장 가지고 있습니다. 키로수는 3만5천입니다. 듀크390cc모델과 같은 프레임과 카울이여서 일반 125cc보다 크고 웅장합니다. 풀LCD 계기판, ABS, 편한 포지션 등이 있습니다. 튜닝내역 오스틴 머플러 구조변경완료 조절식 레버 휴대폰거치대 시동일발로 잘걸리며 소모품도 넉넉히 남아있습니다. 현재 속도케이블 고장으로 속도표시는 안됩니다. 메뉴얼 입문용이나 재밌게 타기엔 가성비로 괜찮은것같습니다. 바이크 관해 더 궁금하신건 휴대폰으로 연락주세요. 메뉴얼 입문하시는분들은 조작법 잘 알려드리겠습니다. 220만원에 판매하고 직거래,화물거래 둘다 가능합니다. 지역은 서울 7호선 까치울역 입니다. 010  56O3  9I7O 문자,전화 주세요.','서울 관악구 관악로15길 23-12',2200000,'SELL','2016년식 KTM 듀크125 ABS 모델 판매합니다....',NULL,2),
	 (1431,'2023-10-13 16:20:32.972472','2023-10-13 16:20:32.972472',793,'2017년식 3만키로 탄 흰색 엔맥스 판매합니다. 2017년식 3만3천키로 주행한 nmax 125 abs 입니다. 번호판은 폐지해서 서류3장 갖고있습니다. 타이어 앞뒤로 70이상씩 남아있고 브레이크패드도 넉넉합니다. 경고등뜨는것없고 시동 일발로 잘걸리구요. ABS 정상입니다. 순정을 좋아하는 편이라 미들스크린,열선그립,탑박스브라켓 외엔 신차출고당시 상태입니다. 큰사고나 슬립같은거 없이 얌전히 탔습니다. 자잘한기스,데미지 정도는 있으나 사진 그대로 양호한 편입니다. 영상 찍어둔것있으니 필요하시면 보내드립니다. 더 궁금하신건 휴대폰으로 연락주세요. 160만원에 판매하고 직거래,화물거래 둘다 가능합니다. 지역은 서울 7호선 까치울역 입니다. 010  56O3  9I7O 문자,전화 주세요.','서울 관악구 관악로15길 23-12',1600000,'SELL','2017년식 3만키로 탄 흰색 엔맥스 판매합니다.',NULL,3);
