	 (1449,'2023-08-25 16:21:39.878819','2023-08-25 16:21:39.878819',31,'기종 2015년식 BMW S1000R 정보 주행 누적 수  61.499KM 매장위치  인천 간석오거리역 1호선 결제방법  신용카드최장18개월 , 현금 , 계좌이체 판매금액  750만원 문의전화  olo . 7616 . 4949 상품상태  양호  F TIRE  미쉐린 파워 2CT 70   R TIRE  미쉐린 파워 2CT 70   디스크 및 패드상태 양호, 대소기어 체인 양호  정기 환경검사 완료, 머플러 구조변경 완료  각종소모품 및 각종경정비 모두완료 된 상태  옵션  풀식스 카본 풀카울  아크라포빅 머플러  더블알매니폴더  구변완료  LED 헤드램프  스모그스크린  보조스크린  엔진케이스가드  포크,리어 슬라이더  저먼아이 블랙박스  휴대폰거치대  USB포트  길레스레버 부가 설명 매입 후 매장입고하여 큰 비용들여 퀵쉬프트 고장부분 수리완료, 이치로100합성엔진오일10w60교환,고성능첨가제주입, 뷔르트옥탄부스터주입, 엔진오일필터신품교환,에어필터신품교환,스로틀신품케이블교환,ECU점검후리세팅, 스로틀바디크리닝 각종 경정비 모두 완료하였고 구매 후 큰 비용드실일없이 컨디션 올려두었습니다. 모드별로 입맛에 맞게 운행 가능하며 잔고장이 적고 리터급네이키드지만 다루기쉬워 많이들 찾으시는 인기차종입니다 일발시동, 팬정상작동, 쿨링정상, 알피엠일정, 미션이상무, 엔진상태 양호, 클러치상태양호,조향이상무,전자계통 이상없습니다 ABS브레이크, TCS 미끄럼방지, DDC 댐핑컨트롤로 안전옵션 잘되어있고 모두 정상작동합니다 세차 후 왁스코팅 후 깔끔하게 매장 전시중이니 실제로오셔서 보시면 더욱 마음에드실겁니다','서울 관악구 관악로15길 23-12',7500000,'SELL','s1000r bmw 2015년식 오토바이 판매합니다',NULL,1),
